import React from "react";
import styled from "styled-components";

function Home() {
  return (
    <Container>
      <Controls>
        <Time>
          <TimeControls>
            <TimeSettings src="icons/timer_settings" />
            <TimeSettingsMenu></TimeSettingsMenu>
          </TimeControls>
          <TimeView></TimeView>
        </Time>
        <Restart src="icons/restart.png" className="cyan-icon" />
      </Controls>
    </Container>
  );
}

export default Home;

const Container = styled.div`
  border: 1px solid grey;
  min-height: calc(100vh - 140px);
`;

// controls
const Controls = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  border: 1px solid grey;
`;
const Time = styled.div``;
const TimeControls = styled.div``;
const TimeSettings = styled.img``;
const TimeSettingsMenu = styled.div``;
const TimeView = styled.div``;
const Restart = styled.img`
  width: 24px;
`;
